['from typing import List

def funcImp(arg1: List[int]) -> List[int]:
    count_dict = {}
    for num in arg1:
        if num in count_dict:
            count_dict[num] += 1
        else:
            count_dict[num] = 1
    duplicates = [num for num, count in count_dict.items() if count > 1]
    return duplicates']

